@notice Emitted when a user adds liquidity to a pool.
@param poolIdx The index of the pool to which liquidity is being added.
@param provider The address of the user providing the liquidity.
@param tokenA The first token provided by the user. This is chosen by the user and can be either token in the pair.
@param tokenB The second token provided by the user. This is the other token in the pair.
@param amountA The amount of tokenA being added.
@param amountB The amount of tokenB being added.
@dev The order of tokenA and tokenB is chosen by the user and does not affect the underlying mechanics of the pool.

@notice Emitted when a user redeems their liquidity from a pool.
@param poolIdx The index of the pool from which liquidity is being redeemed.
@param receiver The address of the user receiving the redeemed tokens.
@param thisToken The first token in the pair associated with the LP token of the pool.
@param thatToken The second token in the pair associated with the LP token of the pool.
@param thisOut The amount of thisToken being redeemed.
@param thatOut The amount of thatToken being redeemed.
@dev The order of thisToken and thatToken is determined by the pool and is not chosen by the user.

@notice Allows users to add liquidity to the pool. Taxed tokens are not supported.
@dev Users should approve the tokens to this contract before calling this function.
@param tokenA First token of the pool pair.
@param tokenB Second token of the pool pair.
@param amountA Amount of tokenA to add to the pool.
@param amountB Amount of tokenB to add to the pool.
@param provider The address that will receive the newly minted LP tokens.
